import React, { useState, useContext } from 'react';
import Modal from 'react-modal';
import { instance1 } from "../../../api/axios";
import { AuthContext } from "../../../components/AuthContext";
import SearchCategoria from '../../Buscas/buscaCategoria';

export default function PdfRelatorioPagamentos({ id }) {
  const [modalIsOpen, setModalIsOpen] = useState(false);
  const [filters, setFilters] = useState({
    startDate: '',
    endDate: '',
    fornecedorName: '',
    status: '',
    categoria: '' // Adiciona o filtro de categoria aqui
  });
  const { user } = useContext(AuthContext);
  const currentDate = new Date().toLocaleDateString();

  const openModal = () => setModalIsOpen(true);
  const closeModal = () => setModalIsOpen(false);

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  // Função para lidar com a seleção de categoria
  const handleCategoriaSelect = (categoria) => {
    setFilters({ ...filters, categoria: categoria?.categoria || '' });
  };  

  const applyFilters = () => {
    const params = {
      startDate: filters.startDate || null,
      endDate: filters.endDate || null,
      fornecedorName: filters.fornecedorName || null,
      statusContas: filters.status || null,  // Mudando "status" para "statusContas"
      categoriaS: filters.categoria || null  // Mudando "categoria" para "categoriaS"
    };
  
    instance1.get(`/relatorioPagar`, { params })
      .then(response => {
        generatePdf(response.data);
      })
      .catch(error => {
        console.error('Error fetching filtered data', error);
      });
    closeModal();
    clearFilter();
  };  

  const clearFilter = () => {
    setFilters('');
  }

  const loadPdfMake = async () => {
    try {
      const [pdfMakeModule, pdfFontsModule] = await Promise.all([
        import('pdfmake/build/pdfmake'),
        import('pdfmake/build/vfs_fonts'),
      ]);
  
      const pdfMake = pdfMakeModule.default || pdfMakeModule;
      const pdfFonts = pdfFontsModule.default || pdfFontsModule;
  
      pdfMake.vfs = pdfFonts.pdfMake?.vfs || pdfFonts.vfs;
  
      return pdfMake;
    } catch (error) {
      console.error("Error loading pdfMake:", error);
      throw error;
    }
  };  

  const generatePdf = async (data) => {
    try {
      const pdfMake = await loadPdfMake();

      const formatValue = (value) => {
        if (typeof value === 'number') {
          return `R$ ${value.toFixed(2).replace('.', ',').replace(/\B(?=(\d{3})+(?!\d))/g, '.')}`;
        }
        return value || ''; // Retorne uma string vazia se o valor for null ou undefined
      };

      const formatDate = (date) => {
        if (!date || date === "" || date === "01/01/1970") return ""; // Condições para retornar vazio
        return date;
      };

      const { startDate, endDate } = filters; // Desestruture os filtros

      const documentDefinition = {
        content: [
          { text: "Relatório Contas a pagar", style: "title" },
          { text: `Usúario: ${user.nome}`, style: "info" },  // Nome do usuário
          { text: `solicitação: ${currentDate}`, style: "info" },  // Nome do usuário
          {
            text: startDate && endDate
              ? `Período: ${new Date(startDate).toLocaleDateString()} até ${new Date(endDate).toLocaleDateString()}`
              : "Período não especificado",
            margin: [0, 0, 0, 10],
          },
          {
            table: {
              headerRows: 1,
              widths: [50, 138, 42, 70, 70, 80, 60],
              body: [
                [
                  { text: "Status", alignment: "center" },
                  { text: "Cliente", alignment: "center" },
                  { text: "Parcela", alignment: "center" },
                  { text: "Vencimento", alignment: "center" },
                  { text: "Pagamento", alignment: "center" },
                  { text: "Valor parcela", alignment: "center" },
                  { text: "Categoria", alignment: "center" },
                ],
                ...data.map(item => ([
                  { text: item.situacao, margin: [0, 2] },
                  { text: item.fornecedor || "N/A", margin: [0, 2] },
                  { text: `${item.parcelas}°`, margin: [0, 2] },
                  { text: formatDate(item.vencimento || ""), margin: [0, 2] },
                  { text: formatDate(item.dataPagamento || ""), margin: [0, 2] },
                  { text: formatValue(item.valorTotal || 0), margin: [0, 2] },
                  { text: formatValue(item.categoria || ""), margin: [0, 2] },
                ])),
              ],
            },
          },
        ],
        background: [
          {
            image: 'data:image/jpeg;base64,',
            width: 595, // largura da imagem
            height: 842, // altura da imagem (A4)
            opacity: 0.3, // Transparência para não cobrir completamente o conteúdo
            absolutePosition: { x: 0, y: 0 } // Posição da imagem
          }
        ],
        styles: {
          header: { fontSize: 18, bold: true },
          textdefault: { fontSize: 11, alignment: "start", fillColor: '#d3d3d3' },
          textRecibo: { fontSize: 15, alignment: "start", fillColor: '#d3d3d3' },
          title: { fontSize: 15, alignment: "start", fillColor: '#d3d3d3' }
        },
      
        defaultStyle: { alignment: "start" },
        pageSize: 'A4',
        pageMargins: [10, 105, 10, 10],
      
        header: function(currentPage, pageCount) {
          return {
            text: `${currentPage}/${pageCount}`,
            alignment: 'right',
            margin: [ 0, 10, 20, 0]  // Margem para o canto superior esquerdo
          };
        }
      };
      

      if (data.length > 0) {
        pdfMake.createPdf(documentDefinition).download(`Conta_Pagar_${currentDate}.pdf`);
      }
    } catch (error) {
      console.error("Error generating PDF", error);
    }
  };


  return (
    <div>
      <button onClick={openModal}
        className="bg-emerald-500 text-white py-0.5 px-10 mt-1 ml-2 rounded hover:bg-emerald-600 transition duration-300">
        Gerar PDF
      </button>
      <Modal
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        className="bg-blue-300 w-[50%] h-auto mx-auto my-auto p-5 rounded-md"
        overlayClassName="fixed inset-0 bg-black bg-opacity-60 flex justify-center items-center z-40"
      >
        <h2 className="text-lg font-semibold mb-4">Filtrar Relatório</h2>

        {/* Flex container principal para organizar os inputs e selects */}
        <div className="flex flex-wrap -mx-3 mb-6">
          <div className="w-full md:w-1/3 px-3 mb-4">
            <label htmlFor="status" className="block mb-1 text-black">Status:</label>
            <select
              name="status"
              value={filters.status}
              onChange={handleFilterChange}
              className="w-full px-3 py-2  border rounded"
            >
              <option value="">Todos</option>
              <option value="Aberto">Aberto</option>
              <option value="Parcial">Parcial</option>
              <option value="Atrasado">Atrasado</option>
              <option value="Fechado">Fechado</option>
            </select>
          </div>

          <div className="w-full md:w-1/3 px-3 mb-4">
            <label htmlFor="startDate" className="block mb-1 text-black">Data Inicial:</label>
            <input
              type="date"
              name="startDate"
              value={filters.startDate}
              onChange={handleFilterChange}
              className="w-full px-3 py-2 border rounded"
            />
          </div>

          <div className="w-full md:w-1/3 px-3 mb-4">
            <label htmlFor="endDate" className="block mb-1 text-black">Data Final:</label>
            <input
              type="date"
              name="endDate"
              value={filters.endDate}
              onChange={handleFilterChange}
              className="w-full px-3 py-2 border rounded"
            />
          </div>

          <div className="w-full md:w-1/3 px-3 mb-4">
            <label htmlFor="fornecedorName" className="block mb-1 text-black">Cliente:</label>
            <input
              type="text"
              name="fornecedorName"
              value={filters.fornecedorName}
              onChange={handleFilterChange}
              placeholder="Nome do Cliente"
              className="w-full px-3 py-2 border rounded"
            />
          </div>

          <div className="w-full md:w-1/3 px-3 ">
            <label htmlFor="categoria" className="block mb-1 text-black">Categoria:</label>
            <SearchCategoria
              onSelectCategoria={handleCategoriaSelect}
              initialCategoria={filters.categoria} // Passando a categoria inicial, se houver
            />
          </div>
        </div>

        {/* Botões de ação */}
        <div className="flex justify-end mt-4">
          <button
            onClick={applyFilters}
            className="bg-blue-500 text-white py-1 px-4 rounded mr-3 hover:bg-blue-600 transition duration-300"
          >
            Aplicar Filtros
          </button>
          <button
            onClick={closeModal}
            className="bg-red-500 text-white py-1 px-4 rounded hover:bg-red-600 transition duration-300"
          >
            Fechar
          </button>
        </div>
      </Modal>
    </div>
  );
} 